import {Link} from 'react-router-dom';

export const NavBarCustomer = () => {
  return (
    <div className='navbar'>
      <div><h1>CUSTOMER</h1></div>
      <div>
      <Link to='/allCoupons'><h3></h3></Link>
        <Link to='/myCoupons'><h3>My coupon</h3></Link>
        <Link to='/coupons/category'><h3>My coupon by category</h3></Link>
        <Link to='/coupons/maxPrice'><h3>My coupon by maxToPay</h3></Link>
        <Link to='/getDetails'><h3>My Details</h3></Link>
        </div>
    </div>
  )
}
